import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './booktickets.css';


function BookTickets() {
  const [numPersons, setNumPersons] = useState(1);
  const [formData, setFormData] = useState({
    flight: '',
    location: '',
    date: '',
  });
  const [passengers, setPassengers] = useState([]);
  const [totalFare, setTotalFare] = useState(0);

  const fareMapping = {
    Emirates: 500,
    AirIndia: 400,
    SpiceJet: 300,
  };

  const navigate = useNavigate();

  useEffect(() => {
    // Initialize passengers array when numPersons changes
    setPassengers(Array.from({ length: numPersons }, (_, i) => passengers[i] || { name: '', email: '', phone: '' }));
  }, [numPersons]);

  const handleNumberChange = (e) => {
    const value = parseInt(e.target.value);
    setNumPersons(value);
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });

    // Update total fare when flight changes
    if (name === 'flight') {
      const selectedFare = fareMapping[value] || 0;
      setTotalFare(selectedFare * numPersons);
    }
  };

  const handlePassengerChange = (index, e) => {
    const { name, value } = e.target;
    const updatedPassengers = [...passengers];
    updatedPassengers[index][name] = value;
    setPassengers(updatedPassengers);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const bookingData = {
      flight: formData.flight,
      location: formData.location,
      departureDate: formData.date,
      passengers: passengers.map(passenger => ({
        ...passenger,
        tstatus: 'departure', // Add tstatus for each passenger
      })),
    };

    try {
      await Promise.all(bookingData.passengers.map(passenger =>
        axios.post('http://localhost:8080/Passenger/Insertpass', passenger)
      ));
      
      
    } catch (error) {
      console.error("There was an error inserting the passengers!", error);
    }
  };

  return (
    <div className="book-tickets-container">
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <h2>Book Your Flight</h2>
          <label>Number of Persons:</label>
          <input
            type="number"
            min="1"
            value={numPersons}
            onChange={handleNumberChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Flight:</label>
          <select
            className="flights"
            name="flight"
            value={formData.flight}
            onChange={handleChange}
            required
          >
            <option value="">Select Flight</option>
            <option value="Emirates">Emirates</option>
            <option value="AirIndia">Air India</option>
            <option value="SpiceJet">Spice Jet</option>
          </select>
        </div>
        <div className="form-group">
          <label>Location:</label>
          <input
            type="text"
            name="location"
            placeholder="Location"
            value={formData.location}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Departure Date:</label>
          <input
            type="date"
            name="date"
            value={formData.date}
            onChange={handleChange}
            required
          />
        </div>

        {passengers.map((passenger, index) => (
          <div key={index} className="passenger-form">
            <h3>Passenger {index + 1}</h3>
            <label>Name:</label>
            <input
              type="text"
              name="name"
              placeholder="Name"
              value={passenger.name}
              onChange={(e) => handlePassengerChange(index, e)}
              required
            />
            <label>Email:</label>
            <input
              type="email"
              name="email"
              placeholder="Email"
              value={passenger.email}
              onChange={(e) => handlePassengerChange(index, e)}
              required
            />
            <label>Phone Number:</label>
            <input
              type="text"
              name="phone"
              placeholder="Phone"
              value={passenger.phone}
              onChange={(e) => handlePassengerChange(index, e)}
              required
            />
          </div>
        ))}

        <div className="form-group">
          <label>Total Fare: ${totalFare}</label>
        </div>
        <button type="submit">Book Now</button>
      </form>
    </div>
  );
}

export default BookTickets;
